import { StatusBar } from 'expo-status-bar';
import { Image, StyleSheet, Text, View } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import Hinh1 from './component/Hinh1';
import Hinh2 from './component/Hinh2';
import Hinh3 from './component/Hinh3';
import Screen01 from './component/Screen01'
export default function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Screen01">
        <Stack.Screen name="Hinh1" component={Hinh1} />
        <Stack.Screen name="Hinh2" component={Hinh2} options={{title:'aa',headerRight:()=>(
        <View>
          <Text>dasdas</Text>
        </View>
        )}}  />
        <Stack.Screen name="Hinh3" component={Hinh3} /> 
        <Stack.Screen name="Screen01" component={Screen01} options={{title:'',headerRight:({route})=>(
        <View>
          <Text>{route.params.name}</Text>d
        </View>
        )}}/>
      </Stack.Navigator>
    </NavigationContainer>
  );
}
const Stack = createNativeStackNavigator();
